ration" : 0, "length" : 0, "etc1" : "", "lineNo" : 7 }, { "begin" : 26250, "end" : 28000, "text" : "예 정보 확인해 주셔서 감사합니다 네 잠시만 기다려 주시겠습니까", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 8 }, { "begin" : 29750, "end" : 31500, "text" : "아 네 감사합니다 네 고객님 지금 그 박상미 님 우리은행으로 자동이체 되고 있는 건이 있고", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 9 }, { "begin" : 33250, "end" : 35000, "text" : "네 그다음 김가람 님 우리은행으로 자동이체 돼 있는 건도 있는데 어떤 거를 지금 변경하시는 건가요", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 10 }, { "begin" : 36750, "end" : 38500, "text" : "네", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 11 }, { "begin" : 40250, "end" : 42000, "text" : "지금 이 김가람 님 김나리 님 그 건강보험 이 두 건은 김가람 님 우리은행으로 지금 되어 있는 상태인데요", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 12 }, { "begin" : 43750, "end" : 45500, "text" : "네 우리은행 김가람 님 계좌로 돼 있는데요", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 13 }, { "begin" : 47250, "end" : 49000, "text" : "네 두 건은 네 김가람 님 우리은행으로 돼 있어요", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 14 }, { "begin" : 50750, "end" : 52500, "text" : "지금 그 박상미 님 안전벨트 보험은 육천 삼백원 그리고", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 15 }, { "begin" : 54250, "end" : 56000, "text" : "에버리치 상해보험 만 구천 이백원", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 16 }, { "begin" : 57750, "end" : 59500, "text" : "그다음 박상미 님의 건강보험은 사만 구천 사백원 이렇게 돼 있고요", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 17 }, { "begin" : 61250, "end" : 63000, "text" : "네 잠시만 기다려 주시겠습니까 제가 한 번 더 확인하겠습니다", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 18 }, { "begin" : 63000, "end" : 64750, "text" : "그리고 그 추가로 그 김남진 님 건강보험 있잖아요", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 19 }, { "begin" : 66500, "end" : 68250, "text" : "이만 삼천 백원 이렇게 네 건이 그 고객님 우리은행으로 자동이체가 되어 있으세요", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 20 }, { "begin" : 70000, "end" : 71750, "text" : "고객님 그러면은 이 경우는 김가람 님이 전화 주셔야 되세요 예금주", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 21 }, { "begin" : 73500, "end" : 75250, "text" : "네 예금주가", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 22 }, { "begin" : 77000, "end" : 78750, "text" : "고객님 통장으로 변경하면은 상관없어요 고객님 근데 지금", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 23 }, { "begin" : 80500, "end" : 82250, "text" : "다른 분 통장으로 해야 되잖아요", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 24 }, { "begin" : 84000, "end" : 85750, "text" : "네 그렇기 때문에 그 예금주가 저희 쪽에 전화 주셔서", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 25 }, { "begin" : 87500, "end" : 89250, "text" : "그 계약자 김남진 정보 확인해 주시고 변경 요청을 하셔야 되세요", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "duration" : 0, "length" : 0, "etc1" : "", "lineNo" : 26 }, { "begin" : 91000, "end" : 92750, "text" : "감사합니다 저는 한미애입니다", "speaker" : "tx", "overlap" : 0, "silence" : 0, "speed" : 0.0, "d